import React from "react";

function Navbar() {
  const blankSpace = {
    float: "left",
    width: "35%",
  };

  const tabStyle = {
    float: "left",
    width: "10%",
    padding: "5",
  };

  return (
    <div className="navbar-container">
      <div style={blankSpace}></div>
      <h1 style={tabStyle}>Home</h1>
      <h1 style={tabStyle}>About</h1>
      <h1 style={tabStyle}>Portfolio</h1>
      <div style={blankSpace}></div>
    </div>
  );
}

export default Navbar;
